browser_download_url\":\"https://github.com/junegunn/fzf-bin/releases/download/0.20.0/fzf-0.20.0-windows_amd64.zip\"}],\"tarball_url\":\"https://api.github.com/repos/junegunn/fzf-bin/tarball/0.20.0\",\"zipball_url\":\"https://api.github.com/repos/junegunn/fzf-bin/zipball/0.20.0\",\"body\":\"-
        Customizable preview window color (`preview-fg` and `preview-bg` for `--color`)\\r\\n
        \ - ![image](https://user-images.githubusercontent.com/700826/71013348-e6f3af80-2133-11ea-8297-8deb83a8a24e.png)\\r\\n\\r\\n-
        Removed the immediate flicking of the screen on `reload` action.\\r\\n  ```sh\\r\\n
        \ : | fzf --bind 'change:reload:seq {q}' --phony\\r\\n  ```\\r\\n- Added `clear-query`
        and `clear-selection` actions for `--bind`\\r\\n- It is now possible to split
        a composite bind action over multiple `--bind` expressions by prefixing the
        later ones with `+`.\\r\\n  ```sh\\r\\n  fzf --bind 'ctrl-a:up+up'\\r\\n\\r\\n
        \ # Can be now written as\\r\\n  fzf --bind 'ctrl-a:up' --bind 'ctrl-a:+up'\\r\\n\\r\\n
        \ # This is useful when you need to write special execute/reload form (i.e.
        `execute:...`)\\r\\n  # to avoid parse errors and add more actions to the
        same key\\r\\n  fzf --multi --bind 'ctrl-l:select-all+execute:less {+f}' --bind
        'ctrl-l:+deselect-all'\\r\\n  ```\\r\\n- Fixed parse error of `--bind` expression
        where concatenated execute/reload action contains `+` character.\\r\\n  ```sh\\r\\n
        \ fzf --multi --bind 'ctrl-l:select-all+execute(less {+f})+deselect-all'\\r\\n
        \ ```\\r\\n- Fixed bugs of reload action\\r\\n    - Not triggered when there's
